import React, { useState, useEffect } from 'react';
import { FormGroup, Checkbox } from '@material-ui/core';

export class CheckboxField extends React.PureComponent {

  handleCheck = (event, isInputChecked) => {
    this.props.onChange(event, isInputChecked, this.props.category);
    console.log('what the heck is isInputChecked', isInputChecked);
  };


  render() {
    return (
      <FormGroup style={{flexDirection: 'row'}}>
          <Checkbox
            label='1=(most privileged)'
            iconStyle={{fill: '#000'}}
            value='1'
            onCheck={this.handleCheck}
          />
          <Checkbox
            label='2'
            iconStyle={{fill: '#000'}}
            value='2'
            onCheck={this.handleCheck}
          />
          <Checkbox
            label='3'
            iconStyle={{fill: '#000'}}
            value='3'
            onCheck={this.handleCheck}
          />
          <Checkbox
            label='4'
            iconStyle={{fill: '#000'}}
            value='4'
            onCheck={this.handleCheck}
          />
          <Checkbox
            label='5'
            iconStyle={{fill: '#000'}}
            value='5'
            onCheck={this.handleCheck}
          />
          <Checkbox
            label='6'
            iconStyle={{fill: '#000'}}
            value='6'
            onCheck={this.handleCheck}
          />
          <Checkbox
            label='7=(Most marginalized)'
            iconStyle={{fill: '#000'}}
            value='7'
            onCheck={this.handleCheck}
          />
        </FormGroup>
    )}
}

export default CheckboxField;
